    "Successfully deleted 1 share link": "\u062a\u0645 \u062d\u0630\u0641 \u0631\u0627\u0628\u0637 \u0645\u0634\u0627\u0631\u0643\u0629 \u0648\u0627\u062d\u062f \u0628\u0646\u062c\u0627\u062d",
