    "Successfully invited %(email) and %(num) other people.": "\u062a\u0645\u062a \u062f\u0639\u0648\u0629 %(email) \u0648 %(num) \u0623\u062e\u0631\u0648\u0646 \u0628\u0646\u062c\u0627\u062d.",
