    "Successfully moved %(name)s and %(amount)s other items.": "\u062a\u0645 \u0646\u0642\u0644 %(name)s \u0648 %(amount)s \u0639\u0646\u0627\u0635\u0631 \u0623\u062e\u0631\u0649 \u0628\u0646\u062c\u0627\u062d.",
