    "Successfully unstarred {library_name_placeholder}.": "\u062a\u0645 \u0625\u0644\u063a\u0627\u0621 \u062a\u0623\u0634\u064a\u0631 \u0627\u0644\u0645\u0643\u062a\u0628\u0629 {library_name_placeholder} \u064a\u0646\u062c\u0627\u062d",
