    "The imported tag already exists": "\u0627\u0644\u0639\u0644\u0627\u0645\u0629 \u0627\u0644\u0645\u0633\u062a\u0648\u0631\u062f\u0629 \u0645\u0648\u062c\u0648\u062f\u0629 \u0628\u0627\u0644\u0641\u0639\u0644",
    "The imported tags are invalid": "\u0627\u0644\u0639\u0644\u0627\u0645\u0627\u062a \u0627\u0644\u0645\u0633\u062a\u0648\u0631\u062f\u0629 \u063a\u064a\u0631 \u0635\u0627\u0644\u062d\u0629",
    "The link is copied to the clipboard.": "\u062a\u0645 \u0646\u0633\u062e \u0627\u0644\u0631\u0627\u0628\u0637 \u0625\u0644\u0649 \u0627\u0644\u062d\u0627\u0641\u0638\u0629.",
    "The list of added, deleted and modified files will be sent to your mailbox.": "\u0633\u064a\u062a\u0645 \u0625\u0631\u0633\u0627\u0644 \u0642\u0627\u0626\u0645\u0629 \u0627\u0644\u0645\u0644\u0641\u0627\u062a \u0627\u0644\u0645\u0636\u0627\u0641\u0629 \u0648\u0627\u0644\u0645\u062d\u0630\u0648\u0641\u0629 \u0648\u0627\u0644\u0645\u0639\u062f\u0644\u0629 \u0625\u0644\u0649 \u0635\u0646\u062f\u0648\u0642 \u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u062e\u0627\u0635 \u0628\u0643.",
    "The name \"{name}\" is already taken. Please choose a different name.": "\u0627\u0644\u0627\u0633\u0645 \"{name}\" \u0645\u0633\u062a\u062e\u062f\u0645 \u0628\u0627\u0644\u0641\u0639\u0644. \u0627\u0644\u0631\u062c\u0627\u0621 \u0627\u062e\u062a\u064a\u0627\u0631 \u0627\u0633\u0645 \u0645\u062e\u062a\u0644\u0641.",
    "The owner of this library has run out of space.": "\u0644\u0645 \u064a\u0639\u062f \u0644\u062f\u0649 \u0645\u0627\u0644\u0643 \u0647\u0630\u0647 \u0627\u0644\u0645\u0643\u062a\u0628\u0629 \u0645\u0633\u0627\u062d\u0629.",
    "The password is too short.": "\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0642\u0635\u064a\u0631\u0629 \u062c\u062f\u0627.",
    "The password is too weak. It should include at least {passwordStrengthLevel} of the following: number, upper letter, lower letter and other symbols.": "\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0636\u0639\u064a\u0641\u0629 \u062c\u062f\u0627. \u064a\u062c\u0628 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0642\u0648\u0629 \u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 {passwordStrengthLevel}  \u0648\u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0627\ufef7\u0642\u0644: \u0623\u0631\u0642\u0627\u0645 \u060c \u0623\u062d\u0631\u0641 \u0643\u0628\u064a\u0631\u0629 \u0648 \u0623\u062d\u0631\u0641 \u0635\u063a\u064a\u0631\u0629 \u0648\u0631\u0645\u0648\u0632 \u0623\u062e\u0631\u0649.",
    "The password will be kept in the server for only 1 hour.": "\u0633\u064a\u062a\u0645 \u0627\u0644\u0627\u062d\u062a\u0641\u0627\u0638 \u0628\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0639\u0644\u0649 \u0627\u0644\u062e\u0627\u062f\u0645 \u0644\u0645\u062f\u0629 \u0633\u0627\u0639\u0629 \u0648\u0627\u062d\u062f\u0629 \u0641\u0642\u0637.",
    "This file has (apparently) not been accessed yet": "\u0644\u0645 \u064a\u062a\u0645 \u0627\u0644\u0648\u0635\u0648\u0644 (\u0638\u0627\u0647\u0631\u064a\u0627) \u0644\u0647\u0630\u0627 \u0627\u0644\u0645\u0644\u0641 \u062d\u062a\u0649 \u0627\u0644\u0627\u0646",
    "This folder has been shared to {user_amount} user(s) and {group_amount} group(s).": "\u062a\u0645\u062a \u0645\u0634\u0627\u0631\u0643\u0629 \u0647\u0630\u0627 \u0627\u0644\u0645\u062c\u0644\u062f \u0645\u0639 {user_amount} \u0645\u0646 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0623\u0648 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645\u064a\u0646 \u0648 {group amount} \u0645\u062c\u0645\u0648\u0639\u0629 \u0623\u0648 \u0645\u062c\u0645\u0648\u0639\u0627\u062a.",
