    "This library has been shared to {user_amount} user(s) and {group_amount} group(s).": "\u062a\u0645\u062a \u0645\u0634\u0627\u0631\u0643\u0629 \u0647\u0630\u0647 \u0627\u0644\u0645\u0643\u062a\u0628\u0629 \u0645\u0639 {user_amount} \u0645\u0633\u062a\u062e\u062f \u0623\u0648 \u0645\u0633\u062a\u062e\u062f\u0645\u064a\u0646 \u0648 {group amount} \u0645\u062c\u0645\u0648\u0639\u0629 \u0623\u0648 \u0645\u062c\u0645\u0648\u0639\u0627\u062a.",
