    "Tip: libraries deleted {placeholder} days ago will be cleaned automatically.": "\u062a\u0644\u0645\u064a\u062d: \u0627\u0644\u0645\u0643\u062a\u0628\u0627\u062a \u0627\u0644\u0645\u062d\u0630\u0648\u0641\u0629 \u0642\u0628\u0644 {placeholder} \u064a\u0648\u0645\u0627 \u0633\u064a\u062a\u0645 \u062a\u0646\u0638\u064a\u0641\u0647\u0627 \u062a\u0644\u0642\u0627\u0626\u064a\u0627\u064b.",
